import React from 'react'
import './Links.css'

function Contact() {
  return (
    <div className='page-links'>
      <p className='page-header'>links</p>
      <div className='link resume'>resume pdf</div>
      <div className='link git'>github</div>
      <div className='link email'>email: phmichelle8@gmail.com</div>
    </div>
  )
}

export default Contact
